Method.Source:
[Form]
public class InventSiteInwardGateEntry_IN extends FormRun
{
    InventDimCtrl_Frm_EditDimensions   inventDimFormSetup;
}

/// <summary>
/// Performs specific actions when a form is initialized.
/// </summary>
public void init()
{
    super();

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

/// <summary>
/// This method returns the <c>InventDimCtrl_Frm_EditDimensions</c> object.
/// </summary>
/// <returns>
/// <c>InventDimCtrl_Frm_EditDimensions</c> object.
/// </returns>
Object inventDimSetupObject()
{
    return inventDimFormSetup;
}

/// <summary>
/// This method is used for the title.
/// </summary>
public void setTitleText()
{
    headerTitle.text(strFmt('%1 : %2 - %3', inventSiteGateEntry_IN.Type,
                                            inventSiteGateEntry_IN.EntryId,
                                            enum2str(inventSiteGateEntry_IN.ReferenceDocumentType)));
}

/// <summary>
/// This method is used for handling the controls based on certain conditions.
/// </summary>
/// <param name="mode">
/// InventDimFormDesignUpdate value.
/// </param>
/// <exception cref="Exception::Error">
/// Incorrect parameter for the function.
/// </exception>
public void updateDesign(InventDimFormDesignUpdate mode)
{
    boolean open;
    boolean vehicleEntered;
    boolean measured;
    boolean tareCheck;
    boolean isOther;
    boolean isPurchOrder;
    boolean isSalesOrder;
    boolean isTransferOrder;
    boolean isRGP;
    boolean isSubContractReturn;

    switch (InventSiteGateEntry_IN.Status)
    {
        case InventSiteGateEntryStatus_IN::Open :
            open = true;
            break;

        case InventSiteGateEntryStatus_IN::VehicleEntered :
            vehicleEntered = true;
            break;

        case InventSiteGateEntryStatus_IN::Measured :
            measured = true;
            break;

        case InventSiteGateEntryStatus_IN::TareCheck :
            tareCheck = true;
            break;
    }

    switch (InventSiteGateEntry_IN.ReferenceDocumentType)
    {
        case InventSiteGateRefDocType_IN::Others :
            isOther = true;
            break;

        case InventSiteGateRefDocType_IN::PurchaseOrder :
            isPurchOrder = true;
            break;

        case InventSiteGateRefDocType_IN::SalesReturnOrder :
            isSalesOrder = true;
            break;

        case InventSiteGateRefDocType_IN::StockTransferIn :
            isTransferOrder = true;
            break;

        case InventSiteGateRefDocType_IN::SubContractReturn :
            isSubContractReturn = true;
            break;

        case InventSiteGateRefDocType_IN::ReturnableGatePassReturn :
            isRGP = true;
            break;
    }

    this.setTitleText();
    InventSiteGateConfirmVehicleEntry_IN.enabled(open && InventSiteGateEntry_IN.existInventSiteGateEntryLine());
    InventSiteGateEntryConfirmMeasurement_IN.enabled(vehicleEntered && !InventSiteGateEntry_IN.SkipMeasurement);
    InventSiteGateEntryConfirmTareCheck_IN.enabled(measured && !InventSiteGateEntry_IN.SkipMeasurement);
    InventSiteGateEntryConfirmVehicleExit_IN.enabled(tareCheck || (InventSiteGateEntry_IN.SkipMeasurement && vehicleEntered));

    InventGateEntryCopyFromPurchLines_IN.enabled(open && isPurchOrder);
    InventGateEntryCopyFromSalesLines_IN.enabled(open && isSalesOrder);
    InventGateEntryCopyFromTransferLines_IN.enabled(open && (isTransferOrder || isSubContractReturn));

    InwardDocumentReferenceLineView.enabled(open && !InventSiteGateEntry_IN.existInventSiteGateEntryLine());
    InwardDocumentReferenceHeaderView.enabled(open && !InventSiteGateEntry_IN.existInventSiteGateEntryLine());

    InventSiteGateEntry_IN_ds.allowDelete(open);
    RGP.visible(isRGP || isSubContractReturn);

    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, SkipMeasurement)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, ApproverEmployee)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, ArrivalDateAndTime)).allowEdit(false);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, ChallanDate)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, ChallanNumber)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, Description)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, DriverMobilePhone)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, OriginCity)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, ReferenceDocumentType)).allowEdit(open);
    InwardDocumentReference_ReferencePartyId.allowEdit(open);
    InwardDocumentReference_ReferencePartyId.visible(!isOther);
    InwardDocumentReference_ReferencePartyId.mandatory(!isOther);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, RetrunableGatePassNumber)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, TransportationCompanyName)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, TransportationDriverName)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, TransportationReceiptDate)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, TransportationReceiptNumber)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, VehicleNumber)).allowEdit(open);
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, InventLocationId)).allowEdit(open && !InventSiteGateEntry_IN.existInventSiteGateEntryLine());
    InventSiteGateEntry_IN_ds.object(fieldnum(InventSiteGateEntry_IN, ExitDateAndTime)).allowEdit(false);

    InventSiteGateEntryLine_IN_ds.allowCreate((isOther || isRGP ) && open && InventSiteGateEntry_IN.RecId);
    InventSiteGateEntryLine_IN_ds.allowDelete(open);

    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, OutwardGateId)).mandatory(isRGP || isSubContractReturn);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, OrderId)).allowEdit(false);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, OrderId)).visible(!isOther && !isRGP);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, LineNum)).allowEdit(false);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, ChallanQty)).allowEdit(open);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, ChallanDate)).allowEdit(open);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, ChallanNumber)).allowEdit(open);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, OrderQty)).allowEdit(false);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, OrderQty)).visible(!isOther && !isRGP);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, Description)).allowEdit(open);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, Description)).mandatory(true);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, ItemId)).allowEdit(open && isOther);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, ItemId)).mandatory(!isOther);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, InventoryUnit)).allowEdit(open && isOther);

    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, MeasuredQty)).allowEdit(vehicleEntered && !InventSiteGateEntry_IN.SkipMeasurement);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, MeasuredQty)).mandatory(vehicleEntered && !InventSiteGateEntry_IN.SkipMeasurement);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, MeasuringInstrumentId)).allowEdit(vehicleEntered && !InventSiteGateEntry_IN.SkipMeasurement);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, MeasuringRunningNumber)).allowEdit(vehicleEntered && !InventSiteGateEntry_IN.SkipMeasurement);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, UnitOfMeasurement)).allowEdit(vehicleEntered && !InventSiteGateEntry_IN.SkipMeasurement);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, UnitOfMeasurement)).mandatory(vehicleEntered && !InventSiteGateEntry_IN.SkipMeasurement);

    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, TareQty)).allowEdit(measured);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, TareQty)).mandatory(measured);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, TareWeightUnit)).allowEdit(measured);
    InventSiteGateEntryLine_IN_ds.object(fieldnum(InventSiteGateEntryLine_IN, TareWeightUnit)).mandatory(measured);
    GateInformationHeaderView_InventSiteGate.width(300);
    GateInformationLineView_InventSiteGate.width(300);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_EditDimensions::newFromForm(element);
            }
            break;

        case InventDimFormDesignUpdate::Active :
        case InventDimFormDesignUpdate::LinkActive :
            inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(InventSiteGateEntryLine_IN.ItemId));
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(InventSiteGateEntryLine_IN.ItemId));
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strfmt("@SYS54195",funcname()));
    }
}

