}

/// <summary>
/// Lists all the invent location records based on the site.
/// </summary>
/// <param name="_formControl">
/// The form control object reference.
/// </param>
/// <param name="_filterStr">
/// The filter string.
/// </param>
public void lookup(FormControl _formControl, str _filterStr)
{
    InventLocation::lookupBySiteIdAllTypes(_formControl, InventSiteGate_IN::find(InventSiteGateEntry_IN.InventSiteGate).SiteId);
}

/// <summary>
/// Performs specific actions when InventSiteGate field is lookup referenced.
/// </summary>
/// <param name="_formReferenceControl">
/// The form control object reference.
/// </param>
/// <returns>
/// <c>InventSiteGate_IN</c> record.
/// </returns>
public Common lookupReference(FormReferenceControl _formReferenceControl)
{
    return InventSiteGate_IN::lookupInventSiteGate(_formReferenceControl, InventSiteGateType_IN::In);
}

/// <summary>
/// Performs specific actions when lookup ReferencePartyId field.
/// </summary>
/// <param name="_formControl">
/// The form control object reference.
/// </param>
/// <param name="_filterStr">
/// The filter string.
/// </param>
public void lookup(FormControl _formControl, str _filterStr)
{
    if (InventSiteGateEntry_IN.ReferenceDocumentType == InventSiteGateRefDocType_IN::StockTransferIn)
    {
        InventSiteGateEntryControllerHelper_IN::lookupInventLocation(_formControl);
    }
    else if (InventSiteGateEntry_IN.ReferenceDocumentType == InventSiteGateRefDocType_IN::SubContractReturn)
    {
        InventSiteGateEntryControllerHelper_IN::lookupInventLocation(_formControl, true);
    }
    else
    {
        super(_formControl, _filterStr);
    }
}

